import { StatusBar } from 'expo-status-bar';
import React from 'react';
import {StyleSheet,Text, View } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import './Constantes/accueil.css'
import restaudata from '../../Constantes/Ship.json';
import Produit from './Components/AccueilComponents/Produit';
import Restaurant from './Components/RestaurantComponents/indexRestaurant';

const Stack = createStackNavigator();

export default function App() {
  return (
   /* <View className="accueil">
      <Restaurant/>
      <StatusBar style="auto" />
    </View>*/
    <NavigationContainer>
    <Stack.Navigator>
      <Stack.Screen
        name = "Restaurant"
        component = {MenuSelection}
        initialParams={{'restauDetails':restaudata}}
      />
      <Stack.Screen
        name = "RecetteDetails"
        component = {RecetteDetails}
      />
    </Stack.Navigator>
  </NavigationContainer>
  );
}
const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
